import Home from './components/Home';
import Navbar from './components/Navbar';
import { BrowserRouter, Route, Router, Routes } from 'react-router-dom'




function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<Navbar />}>
          <Route index element={<Home />}>
         <Route path="/home/gg" element={<Gg />} />
         <Route path="/home/vrc" element={<Vrc />} />
        <Route path="/home/datacenter" element={<Datacenter />} />
         <Route path="/home/spic" element={<Spic />} />


          </Route>

        </Route>
      </Routes>
    </BrowserRouter>

    // <Routes>
